const Post = ({post}) => (
    <div>
      <h2>{post.header}</h2>
      <p>{post.author}</p>
      <p>{post.date}</p>
      <p>{post.text}</p>
      <img src={post.imageSrc} alt={post.imageAlt}/>
    </div>
  );

export default Post;
